  const [team, setTeam] = useState('');

  useEffect(
    () => {
      const fetchMatch = async () => {
        const response = await fetch('http://localhost:8081/dashboard/latestMatchTeam?team=Mumbai Indians');
        const data = await response.json();
        setMatch(data);
      }

    fetchMatch();

    }, []
  );

  return (      
    <div className="teamPage">

      <h2>Team Page</h2>

      <MatchDetailComponent />
      <MatchSmallComponent />
      <MatchSmallComponent />
      <MatchSmallComponent />
    </div>
  );
}

